/*Table structure for table `blog` */

DROP TABLE IF EXISTS `blog`;

CREATE TABLE `blog` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL COMMENT '文章标题',
  `first_picture` varchar(255) NOT NULL COMMENT '文章首图，用于随机文章展示',
  `content` longtext NOT NULL COMMENT '文章正文',
  `description` longtext NOT NULL COMMENT '描述',
  `is_published` bit(1) NOT NULL COMMENT '公开或私密',
  `is_recommend` bit(1) NOT NULL COMMENT '推荐开关',
  `is_appreciation` bit(1) NOT NULL COMMENT '赞赏开关',
  `is_comment_enabled` bit(1) NOT NULL COMMENT '评论开关',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `views` int(11) NOT NULL COMMENT '浏览次数',
  `words` int(11) NOT NULL COMMENT '文章字数',
  `read_time` int(11) NOT NULL COMMENT '阅读时长(分钟)',
  `category_id` bigint(20) NOT NULL COMMENT '文章分类',
  `is_top` bit(1) NOT NULL COMMENT '是否置顶',
  `password` varchar(255) DEFAULT NULL COMMENT '密码保护',
  `user_id` bigint(20) DEFAULT NULL COMMENT '文章作者',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `type_id` (`category_id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

/*Data for the table `blog` */

insert  into `blog`(`id`,`title`,`first_picture`,`content`,`description`,`is_published`,`is_recommend`,`is_appreciation`,`is_comment_enabled`,`create_time`,`update_time`,`views`,`words`,`read_time`,`category_id`,`is_top`,`password`,`user_id`) values (1,'计算机网络','http://localhost:8080/assets/img/logo.png','\n#### 1.TCP/IP四层模型\n\n**网络接口层，网际层，传输层，应用层**\n\n**网络接口层**：这是TCP/IP软件的最低层，负责接收IP数据包并通过网络发送之，或者从网络上接收物理帧，抽出IP数据报，交给IP层。(帧，网络接口协议)\n\n**网际层**：负责点到点（point-to-point）的传输（这里的\"点\"指主机或路由器）主要定义了IP地址格式,使得不同应用类型的数据在Internet上传输。提供基本的数据封包传送功能，让每一块数据包都能够到达目的主机（但不检查是否被正确接收），如网际协议（IP）\n\n**传输层**：提供端到端(end-to-end)的传输(这里的\"端\"指源主机到目标主机) 在此层中，它提供了节点间的数据传送服务，如传输控制协议（TCP）、用户数据报协议（UDP）等，TCP和UDP给数据包加入传输数据并把它传输到下一层中，这一层负责传送数据，并且确定数据已被送达并接收\n\n**应用层** 应用程序间沟通的层，如简单电子邮件传输(SMTP)文件传输协议（FTP）网络远程访问协议（Telnet）域名解析协议（DNS）等\n\n#### 2.OSI七层模型\n\n物理层，数据链路层，网络层，传输层，会话层，表示层，应用层\n\n**应用层：** 就是应用软件使用的协议，如邮箱使用的POP3，SMTP、远程登录使用的Telnet、获取IP地址的DHCP、域名解析的DNS、网页浏览的http协议等；这部分协议主要是规定应用软件如何去进行通信的。\n\n**表示层：** 决定数据的展现（编码）形式，如同一部电影可以采样、量化、编码为RMVB、AVI，一张图片能够是JPEG、BMP、PNG等。\n\n**会话层：** 为两端通信实体建立连接（会话），中间有认证鉴权以及检查点记录（供会话意外中断的时候可以继续，类似断点续传）。\n\n**传输层：** 将一个数据/文件斩件分成很多小段，标记顺序以被对端接收后可以按顺序重组数据，另外标记该应用程序使用的端口号及提供QOS。（不同的应用程序使用不同计算机的端口号，同样的应用程序需要使用一样的端口号才能正常通信）\n\n**网络层：** 路由选择，选择本次通信使用的协议（http、ftp等），指定路由策略及访问控制策略。（IP地址在这一层）\n\n**数据链路层：** 根据端口与MAC地址，做分组（VLAN）隔离、端口安全、访问控制。（MAC地址在这一层）处理VLAN内的数据帧转发，跨VLAN间的访问，需要上升到网络层。封装成帧、透明传输、差错检测（循环冗余检测保证传输过程中的数据准确性）。\n\n**物理层：** 将数据最终编码为用0、1标识的比特流，然后传输。（例如将题主头像的图片，变为一串01100111100这样的数字来表示）。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/OSI七层.png\" alt=\"OSI七层\" style=\"zoom: 80%;\" />\n\n#### 3.ping 是通过什么协议实现的？ \n\nping是通过ICMP(网际报文控制协议实现)，它属于TCP/IP协议簇中的子协议，与IP协议位于同一层，属于网络层协议，它是定位网络通不通的一个重要手段。\n\nping不需要端口号，因为ping是应用层直接使用网络层ICMP的一个例子，而端口是运输层的概念，ping并没有通过运输层的TCP和UDP等。\n\n#### 4.DNS 域名解析的主要过程 \n\nDNS(Domain Name System)属于应用层协议，它的的功能是进行域名解析，将由字母数字组成的域名转换成由数字组成的IP地址。\n\n##### 域名解析的详细过程\n\n1. 当输入一个域名时，比如www.baidu.com，浏览器会检查缓存中有没有这个域名对应的解析的IP地址，如有，则解析结束。\n2. 若没有，浏览器会查找操作系统缓存中是否有这个域名对应的DNS解析结果。\n3. 若本机无法完成域名的解析，就会真正请求域名服务器来解析这个域名了。操作系统会发送域名到Local DNS（本地的域名服务器），大约80%的域名解析到这里就已经结束，所以Local DNS承担着主要的域名解析任务。\n4. 若Local DNS未命中，就直接到根域名服务器(Root Server)请求解析。\n5. 根域名服务器返回给本地域名服务器一个所查询域的主域名服务器(Top Level Domain (TLD) Server 国际顶级域名服务器)。\n6. 本地域名服务器（Local DNS Server）在向上一步返回的TLD服务器发送请求。\n7. 接受请求的TLD服务器查找并返回此域名对应的Name Server域名服务器的IP地址。\n8. Name Server域名服务器会查询存储的域名和IP的映射关系表，在正常情况下都根据域名得到目标IP记录，连同一个TTL返回给DNS Server域名服务器。\n9. 返回该域名对应的IP和TTL值，Local DNS Server会缓存这个域名和IP的对应关系，缓存的时间由TTL值控制。\n10. 把解析的结果返回给用户，用户根据TTL值缓存在本地系统缓存中，域名解析过程结束。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/DNS域名解析.png\" alt=\"DNS域名解析\" style=\"zoom: 67%;\" />\n\n##### 域名解析的主要过程\n\n1.输入域名时，首先在浏览器和本机查找有无该域名对应ip的缓存，若有直接返回。\n\n2.若无，则向本地DNS服务器请求，无，再向根DNS服务器请求，根返回顶级服务器的ip\n\n3.本地DNS向顶级服务器请求name server的ip，再向name server请求我们需要解析的域名的ip，查找映射表并返回给本地DNS。\n\n4.最终本地DNS返回解析的ip地址。\n\n#### 5.什么是DNS劫持\n\n就是当你输入百度的域名时，你的DNS服务器返回的不是百度的ip而是其他的网站的ip地址，此时你的DNS就被劫持了，返回了错误的ip地址。\n\n域名劫持是互联网攻击的一种方式，通过攻击域名解析服务器（DNS），或伪造域名解析服务器（DNS）的方法，把目标网站域名解析到错误的IP地址从而实现用户无法访问目标网站的目的或者蓄意或恶意要求用户访问指定IP地址（网站）的目的。\n\n#### 6.介绍一下 IPv6，IPv4\n\n是两种表示ip地址的方式，字节数不同，所能表示的地址数量也不同。\n\nIPv4有4个字节32个比特，如192.168.11.1，由点十进制表示\n\nIPv6有16个字节128个比特，远大于IPv4\n\n#### 7.一个URL 解析过程 \n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/url解析过程.png\" alt=\"url解析过程\" style=\"zoom:67%;\" />\n\n\n\n#### 8.HTTP的报文组成\n\nHTTP有两类报文：**请求报文和响应报文**，由于 HTTP 是面向正文的(text-oriented)，因此在报文中的每一个字段都是一些 ASCII码串，因而每个字段的长度都是不确定的。（HTTP2引入了二进制协议）\n\n  这两种报文的结构基本上是相同的，都是由三部分组成：**开始行**（用于区分是请求报文还是响应报文）、**首部行**（一些键值对，用以说明一些信息）、**实体主体**（请求报文一般不用，响应报文也可能不用）。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/HTTP请求报文.png\" alt=\"HTTP请求报文\" style=\"zoom: 67%;\" />\n\n#### 9.HTTP协议有了解什么，HTTP请求头，抓过包去看过吗\n\nHTTP是（超文本传输协议），是用于从WWW服务器传输超文本到本地浏览器的传送协议。它可以使浏览器更加高效，使网络传输减少。它不仅保证计算机正确快速地传输超文本文档，还确定传输文档中的哪一部分，以及哪部分内容首先显示(如文本先于图形)等。\n\nHTTP是一个应用层协议，由请求和响应构成，是一个标准的客户端服务器模型。HTTP是一个无状态的协议。\n\n使用**Wireshark**抓TCP、http包\n\nHTTP响应头和请求头信息对照表\n\nHTTP请求头提供了关于请求，响应或者其他的发送实体的信息。HTTP的头信息包括通用头、请求头、响应头和实体头四个部分。每个头域由一个域名，冒号（:）和域值三部分组成。\n\n- **通用头标**：即可用于请求，也可用于响应，是作为一个整体而不是特定资源与事务相关联。\n- **请求头标**：允许客户端传递关于自身的信息和希望的响应形式。\n- **响应头标**：服务器和于传递自身信息的响应。\n- **实体头标**：定义被传送资源的信息。即可用于请求，也可用于响应。\n\n**http请求头**\n\n包含请求地址，请求方法，资源地址，协议，接收数据的格式，接收编码的格式，接收语言的格式，cookie等等信息\n\n```http\nAccept：可以接收的响应内容格式\nConnection：客户端想要优先使用的连接类型，keep-alive、upgrade\nHost：客户端告诉服务端它请求的资源所在的主机与端口号\ncookie：客户端请求时携带的数据\n```\n\n![http请求头](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/http请求头.png)\n\n**http响应头**\n\n![http响应头](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/http响应头.png)\n\n**http通用头**\n\n![http通用头](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/http通用头.png)\n\n#### 10.HTTP状态码\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/HTTP状态码.png\" alt=\"HTTP状态码\" style=\"zoom: 80%;\" />\n\n| 状态码 |                            含义                            |\n| :----: | :--------------------------------------------------------: |\n|  100   |            请求已经接收，客户端可以继续发送请求            |\n|  101   |            服务器已经收到并且理解了客户端的请求            |\n|  200   |                          一切正常                          |\n|  204   |                   请求成功，无资源可返回                   |\n|  206   |              范围请求，请求范围内资源正常返回              |\n|  301   |                         永久重定向                         |\n|  302   |                暂时重定向，URL可能还会改变                 |\n|  400   |                      请求存在语法错误                      |\n|  401   |              请求需要有通过HTTP认证的认证信息              |\n|  403   |                          禁止访问                          |\n|  404   |                   资源没找到，not found                    |\n|  500   | 服务端处理请求发生了错误，或web应用存在某些bug或临时的故障 |\n|  503   |                   服务器过载或者临时维护                   |\n|  504   |       网关超时，代理服务器等待应用服务器响应时的超时       |\n\n#### 11.HTTP接口，项目的前后端请求的接口是通过什么协议（Restful类型）\n\n**REST（Representational State Transfer 表现层状态转换）并没有一个明确的标准，而更像是一种设计的风格**，满足这种设计风格的程序或接口我们称之为RESTful(从单词字面来看就是一个形容词)。所以RESTful API 就是**满足REST架构风格**的接口。\n\n后端提供接口给前端，前端调用API向后台发起HTTP请求，后台响应请求将处理结果反馈给前端。\n\n统一接口：Restful风格的数据元操作CRUD(create,read,update,delete)分别对应HTTP方法：(这句话就是执行什么样的逻辑给出一个对应的对应的控制器方法就好了) \n\n> - GET(SELECT)：从服务器取出资源(一项或多项)。查找\n> - POST(CREATE)：在服务器新建一个资源。增加\n> - PUT(UPDATE)：在服务器更新资源(客户端提供完整资源数据)。修改\n> - PATCH(UPDATE)：在服务器更新资源(客户端提供需要修改的资源数据)。修改\n> - DELETE(DELETE)：从服务器删除资源。删除\n\nhttp请求方法的安全性和幂等性\n\n幂等性指的的是，短时间内多次操作返回同一个结果。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/http请求方法安全性幂等性.png\" alt=\"http请求方法安全性幂等性\" style=\"zoom: 80%;\" />\n\n对于RESTful API的URL具体设计的规范如下：\n\n> - 不用大写字母，所有单词使用英文且小写。\n> - 连字符用中杠\"-\"而不用下杠\"_\"\n> - 正确使用 \"/\"表示层级关系,URL的层级不要过深，并且越靠前的层级应该相对越稳定\n> - 结尾不要包含正斜杠分隔符\"/\"\n> - URL中不出现动词，用请求方式表示动作\n> - 资源表示用复数不要用单数\n> - 不要使用文件扩展名\n\nHTTP状态码：在REST中都有特定的意义：200，201，202，204，400，401，403，500。比如401表示用户身份认证失败，403表示你验证身份通过了，但这个资源你不能操作。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/restful与非restful.png\" alt=\"restful与非restful\" style=\"zoom:80%;\" />\n\n#### 12.TCP 与 UDP 的区别\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP与UDP的区别.png\" alt=\"TCP与UDP的区别\" style=\"zoom:67%;\" />\n\n#### 13.TCP三次握手，为什么要三次握手\n\n**确保双发都能确定自己和对方收发数据正常，若只有两次握手，无法保证**\n\n还有ACK \n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP三次握手.png\" alt=\"TCP三次握手\" style=\"zoom: 67%;\" />\n\n![TCP三次握手2](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP三次握手2.png)\n\n#### 14.TCP四次挥手，为什么要四次挥手\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP四次挥手.png\" alt=\"TCP四次挥手\" style=\"zoom:67%;\" />\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP建立与断开连接.png\" alt=\"TCP建立与断开连接\" style=\"zoom:67%;\" />\n\n![TCP四次挥手2](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP四次挥手2.png)\n\n（1）第一次挥手\n\n​     因此当主动方发送断开连接的请求（即FIN报文）给被动方时，仅仅代表主动方不会再发送数据报文了，但主动方仍可以接收数据报文。\n\n​    （2）第二次挥手\n\n​     被动方此时有可能还有相应的数据报文需要发送，因此需要先发送ACK报文，告知主动方“我知道你想断开连接的请求了”。这样主动方便不会因为没有收到应答而继续发送断开连接的请求（即FIN报文）。\n\n   （3）第三次挥手\n\n​    被动方在处理完数据报文后，便发送给主动方FIN报文；这样可以保证数据通信正常可靠地完成。发送完FIN报文后，被动方进入LAST_ACK阶段（超时等待）。\n\n   （4）第四挥手\n\n​    如果主动方及时发送ACK报文进行连接中断的确认，这时被动方就直接释放连接，进入可用状态。\n\n**为什么需要四次挥手**？\n\n因为TCP是一个全双工协议，**必须单独拆除每一条信道**。4次挥手的目的是终止数据传输，并回收资源，此时两个端点两个方向的序列号已经没有了任何关系，必须等待两方向都没有数据传输时才能拆除虚链路，不像初始化时那么简单，发现SYN标志就初始化一个序列号并确认SYN的序列号。因此必须单独分别在一个方向上终止该方向的数据传输。\n\n如果是三次挥手，会怎么样？三次的话，被动关闭端在收到FIN消息之后，需要同时回复ACK和Server端的FIN消息。如果Server端在该连接上面并没有Pending的消息要处理，那么是可以的，如果Server端还需要等待一段时间才可以关闭另外一个方向的连接，那么这样的三次挥手就不能满足条件。\n\n#### 15.四次挥手是每次都是客户端先发出 FIN 包吗 \n\n不是，客户端和服务器端都可发出FIN包来中断连接。\n\n#### 16.四次挥手最后等待为什么2MSL\n\n两个原因：\n\n1. **确保最后一个确认报文到达**，如果server没有收到client发送来的确认报文，那么就会重新发送连接释放请求报文。客户机等待一段时间就是为了处理这种情况发生。\n2. 等待一段时间是为了**让本连接内产生的所有报文都从网络中消失**，使得下一个新的连接不会出现旧的连接请求报文。\n\n#### 17.TCP 连接是如何保证可靠性？\n\n1. 应⽤数据被分割成 TCP 认为最适合发送的数据块。 \n\n2. TCP 给发送的每⼀个包进⾏编号，接收⽅对数据包进⾏排序，把有序数据传送给应⽤层。 \n3. **校验和**： TCP 将保持它⾸部和数据的检验和。这是⼀个端到端的检验和，⽬的是检测数据在传 输过程中的任何变化。如果收到段的检验和有差错，TCP 将丢弃这个报⽂段和不确认收到此报⽂ 段。\n4. TCP 的接收端会丢弃重复的数据。 \n5. **流量控制**： TCP 连接的每⼀⽅都有固定⼤⼩的缓冲空间，TCP的接收端只允许发送端发送接收端 缓冲区能接纳的数据。当接收⽅来不及处理发送⽅的数据，能提示发送⽅降低发送的速率，防⽌ 包丢失。TCP 使⽤的流量控制协议是可变⼤⼩的滑动窗⼝协议。 （TCP 利⽤滑动窗⼝实现流量 控制）\n6. **拥塞控制**： 当⽹络拥塞时，减少数据的发送。\n7. **ARQ协议**（Automatic Repeat-Request，ARQ）： 也是为了实现可靠传输的，它的基本原理就是每发完⼀个分组就停⽌发送，等待对⽅ 确认。在收到确认后再发下⼀个分组。\n8. **超时重传**： 当 TCP 发出⼀个段后，它启动⼀个定时器，等待⽬的端确认收到这个报⽂段。如果 不能及时收到⼀个确认，将重发这个报⽂段。\n\n#### 18.HTTP 为什么用到 TCP，TCP 怎么做到可靠？（确认重传？超时重传？流量控制）  \n\n因为TCP协议能够保证可靠传输，且安全，而UDP是不可靠的，若使用UDP会导致接收的数据可能会发生错误。\n\n#### 19.TCP 拥塞处理 ，解释一下拥塞控制，与流量控制有什么区别\n\n拥塞控制就是防止过多的数据注入到网络中，这样可以使网络中的路由器或链路不至于过载。(交通堵塞，车流量控制)\n\n属于对整个网络进行拥塞控制，是全局性的的过程，而流量控制是某个发送方与接收方的控制、即点对点。\n\nTCP拥塞控制的方法：\n\n拥塞窗口等于发送窗口，拥塞窗口由发送方根据网络拥塞程度来维持。\n\n**1.慢开始**：由于不知道网络负荷情况，因此在开始传输数据时，发送窗口由小到大，而不是直接发送很大的数据，以免发生拥塞。\n\n**2.拥塞避免**：是让发送窗口缓慢的增大，每经过一个往返时间就将窗口加1，而不是像慢开始加倍增长。一般当拥塞窗口增长到慢开始门限值，开始使用拥塞避免。\n\n**3.快重传**：当发送方收到连续三个重复确认，就知道接收方没有收到某个报文段，该报文段丢失，而不是网络拥塞，因此进行立即重传该丢失报文段。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/拥塞控制-快重传.png\" alt=\"拥塞控制-快重传\" style=\"zoom:50%;\" />\n\n**4.快恢复**：根据快重传得到的信息，发送方知道是丢失某个报文段，而不是网络拥塞，因此不启动慢开始，而是执行快恢复算法，此时将拥塞窗口减小一半，再次执行拥塞避免\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP拥塞控制.png\" alt=\"TCP拥塞控制\" style=\"zoom: 50%;\" />\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/TCP拥塞控制流程.png\" alt=\"TCP拥塞控制流程\" style=\"zoom:50%;\" />\n\n\n\n#### 20.什么是TCP 粘包/拆包，解决办法\n\n粘包、拆包问题是处于网络比较底层的问题，在数据链路层、网络层以及传输层都有可能发生。我们日常的网络应用开发大都在传输层进行，由于**UDP有消息保护边界**，不会发生粘包拆包问题（但会发生丢数据问题），因此粘包拆包问题**只发生在TCP协议**中。\n\n**什么是拆包、粘包：**\n\n假设客户端向服务端连续发送了两个数据包，用packet 1和packet 2来表示，那么服务端收到的数据可以分为三种，现列举如下：\n\n第一种情况，接收端正常收到两个数据包，即没有发生拆包和粘包的现象，此种情况不在本文的讨论范围内。\n\n![数据包正常发送](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/数据包正常发送.png)\n\n第二种情况，接收端只收到一个数据包，由于TCP是不会出现丢包的，所以这**一个数据包中包含了发送端发送的两个数据包**的信息，这种现象即为**粘包**。这种情况由于接收端不知道这两个数据包的界限，所以对于接收端来说很难处理。\n\n![数据包发送粘包](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/数据包发送粘包.png)\n\n第三种情况，这种情况有两种表现形式，如下图。接收端收到了两个数据包，但是这两个数据包要么是不完整的，要么就是多出来一块，这种情况即发生了拆包和粘包。这两种情况如果不加特殊处理，对于接收端同样是不好处理的。\n\n<img src=\"https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/数据包发送拆包.png\" alt=\"数据包发送拆包\" style=\"zoom:50%;\" />\n\n**为什么会发生TCP粘包、拆包？**\n\n发生TCP粘包、拆包主要是由于下面一些原因：\n\n1.应用程序写入的数据大于套接字缓冲区大小，这将会发生拆包。\n\n2.应用程序写入数据小于套接字缓冲区大小，网卡将应用多次写入的数据发送到网络上，这将会发生粘包。\n\n3.进行MSS（最大报文长度）大小的TCP分段，当TCP报文长度-TCP头部长度>MSS的时候将发生拆包。\n\n4.接收方法不及时读取套接字缓冲区数据，这将发生粘包。\n\n**粘包、拆包解决办法**\n\n**TCP本身是面向流的**，作为网络服务器，如何从这源源不断涌来的数据流中拆分出或者合并出有意义的信息呢？通常会有以下一些常用的方法：\n\n1、发送端给每个数据包添加**包首部**，首部中应该至少包含**数据包的长度**，这样接收端在接收到数据后，通过读取包首部的长度字段，便知道每一个数据包的实际长度了。\n\n2、发送端将每个数据包封装为**固定长度**（不够的可以通过补0填充），这样接收端每次从接收缓冲区中读取固定长度的数据就自然而然的把每个数据包拆分开来。\n\n3、可以在数据包之间**设置边界**，如添加特殊符号，这样，接收端通过这个边界就可以将不同的数据包拆分开。\n\n\n\n#### 21.如何实现 UDP 的可靠数据传输？ \n\n最简单的方式是在应用层模仿传输层TCP的可靠性传输。下面不考虑拥塞处理，可靠UDP的简单设计。\n\n- 1、添加seq/ack机制，确保数据发送到对端\n- 2、添加发送和接收缓冲区，主要是用户超时重传。\n- 3、添加超时重传机制。\n\n详细说明：送端发送数据时，生成一个随机seq=x，然后每一片按照数据大小分配seq。数据到达接收端后接收端放入缓存，并发送一个ack=x的包，表示对方已经收到了数据。发送端收到了ack包后，删除缓冲区对应的数据。时间到后，定时任务检查是否需要重传数据。\n\n目前有如下开源程序利用udp实现了可靠的数据传输。分别为*RUDP、RTP、UDT*。\n\n  [UDP可靠传输](https://www.cnblogs.com/williamjie/p/11133180.html)\n\n\n\n#### 22.HTTP协议演进过程\n\nHTTP协议是如今互联网与服务端技术的基石，HTTP协议的演进也从侧面反应了互联网技术的快速发展。这两天在准备一次关于HTTP1.1协议特性的技术分享过程中，顺便了解了下各版本HTTP协议的特点，在这里做个简单的总结。\n\nHTTP协议到现在为止总共经历了3个版本的演化，第一个HTTP协议诞生于1989年3月。\n\n##### 1、HTTP 0.9\n\nHTTP 0.9是第一个版本的HTTP协议，已过时。它的组成极其简单，只允许客户端发送GET这一种请求，且不支持请求头。由于没有协议头，造成了HTTP 0.9协议只支持一种内容，即纯文本。不过网页仍然支持用HTML语言格式化，同时无法插入图片。\n\nHTTP 0.9具有典型的无状态性，每个事务独立进行处理，事务结束时就释放这个连接。由此可见，HTTP协议的无状态特点在其第一个版本0.9中已经成型。一次HTTP 0.9的传输首先要建立一个由客户端到Web服务器的TCP连接，由客户端发起一个请求，然后由Web服务器返回页面内容，然后连接会关闭。如果请求的页面不存在，也不会返回任何错误码。\n\nHTTP 0.9协议文档：\nhttp://www.w3.org/Protocols/HTTP/AsImplemented.html\n\n##### 2、HTTP 1.0\n\nHTTP协议的第二个版本，第一个在通讯中指定版本号的HTTP协议版本，至今仍被广泛采用。相对于HTTP 0.9 增加了如下主要特性：\n\n请求与响应支持头域\n\n响应对象以一个响应状态行开始\n\n响应对象不只限于超文本\n\n开始支持客户端通过POST方法向Web服务器提交数据，支持GET、HEAD、POST方法\n\n支持长连接（但默认还是使用短连接），缓存机制，以及身份认证\n\n##### 3、HTTP 1.1\n\nHTTP协议的第三个版本是HTTP 1.1，是目前使用最广泛的协议版本 。HTTP 1.1是目前主流的HTTP协议版本，因此这里就多花一些笔墨介绍一下HTTP 1.1的特性。\n\nHTTP 1.1引入了许多关键性能优化：keepalive连接，chunked编码传输，字节范围请求，请求流水线等\n\n**Persistent Connection（keepalive连接）**\n允许HTTP设备在事务处理结束之后将TCP连接保持在打开的状态，一遍未来的HTTP请求重用现在的连接，直到客户端或服务器端决定将其关闭为止。\n在HTTP1.0中使用长连接需要添加请求头 Connection: Keep-Alive，而在HTTP 1.1 所有的连接默认都是长连接，除非特殊声明不支持（ HTTP请求报文首部加上Connection: close ）\n\n**chunked编码传输**\n该编码将实体分块传送并逐块标明长度,直到长度为0块表示传输结束, 这在实体长度未知时特别有用(比如由数据库动态产生的数据)\n\n**字节范围请求**\nHTTP1.1支持传送内容的一部分。比方说，当客户端已经有内容的一部分，为了节省带宽，可以只向服务器请求一部分。该功能通过在请求消息中引入了range头域来实现，它允许只请求资源的某个部分。在响应消息中Content-Range头域声明了返回的这部分对象的偏移值和长度。如果服务器相应地返回了对象所请求范围的内容，则响应码206（Partial Content）\n\n**Pipelining**（请求流水线）\nA client that supports persistent connections MAY \"pipeline\" its requests (i.e., send multiple requests without waiting for each response). A server MUST send its responses to those requests in the same order that the requests were received.（摘自http://www.ietf.org/rfc/rfc2616.txt）  \n\n另外，HTTP 1.1还新增了如下特性：\n\n**请求消息和响应消息都应支持**Host头域\n在HTTP1.0中认为每台服务器都绑定一个唯一的IP地址，因此，请求消息中的URL并没有传递主机名（hostname）。但随着虚拟主机技术的发展，在一台物理服务器上可以存在多个虚拟主机（Multi-homed Web Servers），并且它们共享一个IP地址。因此，Host头的引入就很有必要了。\n\n**新增了一批**Request method\nHTTP1.1增加了OPTIONS,PUT, DELETE, TRACE, CONNECT方法\n\n**缓存处理**\nHTTP/1.1在1.0的基础上加入了一些cache的新特性，引入了实体标签，一般被称为e-tags，新增更为强大的Cache-Control头。\n\n##### 4、HTTP 2.0\n\nHTTP 2.0是下一代HTTP协议，目前应用还非常少。主要特点有：\n\n**多路复用**（二进制分帧）\nHTTP 2.0最大的特点: 不会改动HTTP 的语义，HTTP 方法、状态码、URI 及首部字段，等等这些核心概念上一如往常，却能致力于突破上一代标准的性能限制，改进传输性能，实现低延迟和高吞吐量。而之所以叫2.0，是在于新增的二进制分帧层。在二进制分帧层上， HTTP 2.0 会将所有传输的信息分割为更小的消息和帧,并对它们采用二进制格式的编码 ，其中HTTP1.x的首部信息会被封装到Headers帧，而我们的request body则封装到Data帧里面。\n\nHTTP 2.0 通信都在一个连接上完成，这个连接可以承载任意数量的双向数据流。相应地，每个数据流以消息的形式发送，而消息由一或多个帧组成，这些帧可以乱序发送，然后再根据每个帧首部的流标识符重新组装。\n\n**头部压缩**\n当一个客户端向相同服务器请求许多资源时，像来自同一个网页的图像，将会有大量的请求看上去几乎同样的，这就需要压缩技术对付这种几乎相同的信息。\n\n**随时复位**\nHTTP1.1一个缺点是当HTTP信息有一定长度大小数据传输时，你不能方便地随时停止它，中断TCP连接的代价是昂贵的。使用HTTP2的RST_STREAM将能方便停止一个信息传输，启动新的信息，在不中断连接的情况下提高带宽利用效率。\n\n**服务器端推流**: Server Push\n客户端请求一个资源X，服务器端判断也许客户端还需要资源Z，在无需事先询问客户端情况下将资源Z推送到客户端，客户端接受到后，可以缓存起来以备后用。\n\n**优先权和依赖**\n每个流都有自己的优先级别，会表明哪个流是最重要的，客户端会指定哪个流是最重要的，有一些依赖参数，这样一个流可以依赖另外一个流。优先级别可以在运行时动态改变，当用户滚动页面时，可以告诉浏览器哪个图像是最重要的，你也可以在一组流中进行优先筛选，能够突然抓住重点流。\n\n参考资料\n\nHttp 0.9：http://www.w3.org/Protocols/HTTP/AsImplemented.html\n\nHttp 1.0：http://www.ietf.org/rfc/rfc1945.txt\n\nHttp 1.1：http://www.ietf.org/rfc/rfc2616.txt\n\nHttp 2.0：https://tools.ietf.org/html/rfc5741\n\n#### 22.最多能创建多少个TCP连接\n\n##### 1.TCP连接创建模拟实验\n\n我是一个 Linux 服务器上的进程，名叫小进。\n\n老是有人说我最多只能创建 65535 个 TCP 连接。\n\n我不信这个邪，今天我要亲自去实践一下。\n\n我走到操作系统老大的跟前，说：\n\n\"老操，我要建立一个 TCP 连接！\"\n\n老操不慌不忙，拿出一个表格递给我，\"小进，先填表吧\"\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640202203042227.jpeg)\n\n我一看这个表，这不就是经典的 **socket 四元组**嘛。我只有一块网卡，其 IP 地址是 **123.126.45.68**，我想要与 **110.242.68.3** 的 80 端口建立一个 TCP 连接，我将这些信息填写在了表中。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868212228.jpeg)\n\n源端口号填什么呢？我记得端口号是 16 位的，可以有 0 ~ 65535 这个范围的数字，那我随便选一个吧！\n\n正当我犹豫到底选什么数字的时候，老操一把抢过我的表格。\n\n\"你墨迹个啥呢小进？源端口号不用你填，我会给你分配一个可用的数字。源IP也不用你填，我知道都有哪些网卡，并且会帮你选个合适的。真是个新手，回去等消息吧。\"\n\n\"哦\"\n\n老操带着我的表格，走了。\n\n过了很长时间，老操终于回来了，并且带着一个纸条。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868422228.jpeg)\n\n\"小进，你把这个收好了。\"\n\n我问道，\"这是啥呀？\"\n\n老操不耐烦地说道，\"刚刚说你是新手你还不服，这个 5 表示文件描述符，linux 下一切皆文件，你待会和你那个目标 IP 进行 TCP 通信的时候，就对着这个文件描述符读写就好啦。\"\n\n\"这么方便！好的，谢谢老操。\"\n\n我拿着这个文件描述符，把它放到属于我的内存中裱起来了，反正我只是想看看最多能创建多少 TCP 连接，又不是去真的用它，嘻嘻。\n\n**端口号**\n\n过了一分钟，我又去找老操了。\n\n\"老操，我要建立一个 TCP 连接！\"\n\n老操不慌不忙，拿出一个表格递给我，\"小进，先填表吧\"\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868532228.png)\n\n这回我熟悉了，只把目标IP和目标端口填好。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868542229.jpeg)\n\n老操办好事之后，又带着一个纸条回来，上面写着数字\"6\"。\n\n就这样，我每隔一分钟都去找老操建立一个新的 TCP 连接，目标 IP 都是110.242.68.3，目标端口都是 80。\n\n老操也很奇怪，不知道我在这折腾啥，他虽然权力大，但无权拒绝我的指令，每次都兢兢业业地把事情办好，并给我一张一张写着文件描述符的纸条。\n\n直到有一次，我收到的纸条有些不同。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868552230.jpeg)\n\n我带着些许责怪的语气问，\"老操，这是怎么回事呀？\"\n\n老操也没好气地说，\"这表示端口号不够用啦！早就觉得你小子不对劲了，一个劲地对着同一个 IP 和端口创建 TCP 连接，之前没办法必须执行你给的指令，现在不行了，端口号不够用了，源端口那里我没法给你填了。\"\n\n我也不是那么好骗的，质疑道。\"老操，你也别欺负我这个新手，我可是知道端口号是 16 位的，范围是 1~65535，一共可以创建 65535 个 TCP 连接，我现在才创建了 63977 个，怎么就不够了！\"\n\n老操鄙视地看了我一眼，\"你小子可真是闲的蛋疼啊，还真一个个数，来我告诉你吧，Linux 对可使用的端口范围是有具体限制的，具体可以用如下命令查看。\"\n\n```shell\n[root]# cat /proc/sys/net/ipv4/ip_local_port_range \n1024 65000\n```\n\n\"看到没，当前的限制是1024~65000，所以你就只能有63977个端口号可以使用。\"\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868562232.png)\n\n我赶紧像老操道歉，\"哎哟真是抱歉，还是我见识太少，那这个数可以修改么？\"\n\n老操也没跟我一般见识，还是耐心地回答我，\"可以的，具体可以 vim /etc/sysctl.conf 这个文件进行修改，我们在这个文件里添加一行记录\"\n\n```shell\nnet.ipv4.ip_local_port_range = 60000 60009\n```\n\n\"保存好后执行 sysctl -p /etc/sysctl.conf 使其生效。这样你就只有 10 个端口号可以用了，就会更快报出端口号不够用的错误\"\n\n\"原来如此，谢谢老操又给我上了一课。\"\n\n哎不对，建立一个 TCP 连接，需要将通信两端的套接字（socket）进行绑定，如下：\n\n**源 IP 地址：源端口号 <---->  目标 IP 地址：目标端口号**\n\n只要这套绑定关系构成的四元组不重复即可，刚刚端口号不够用了，是因为我一直对同一个目标IP和端口建立连接，那我换一个目标端口号试试。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868572233.jpeg)\n\n我又把这个表交给老操，老操一眼就看破了我的小心思，可是也没办法，马上去给我建立了一个新的TCP连接，并且成功返回给我一个新的文件描述符纸条。\n\n看来成功了，只要源端口号不用够用了，就不断变换目标 IP 和目标端口号，保证四元组不重复，我就能创建好多好多 TCP 连接啦！\n\n这也证明了有人说最多只能创建 65535 个TCP连接是多么荒唐。\n\n**文件描述符**\n\n找到了突破端口号限制的办法，我不断找老操建立TCP连接，老操也拿我没有办法。\n\n直到有一次，我又收到了一张特殊的纸条，上面写的不是文件描述符。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868582233.jpeg)\n\n我又没好气地问老操，\"这又是咋回事？\"\n\n老操幸灾乐祸地告诉我，\"呵呵，你小子以为突破端口号限制就无法无天了？现在文件描述符不够用啦！\"\n\n\"怎么啥啥都有限制啊？你们操作系统给我们的限制也太多了吧？\"\n\n\"废话，你看看你都建了多少个TCP连接了！每建立一个TCP连接，我就得分配给你一个文件描述符，linux 对可打开的文件描述符的数量分别作了三个方面的限制。\"\n\n**系统级**：当前系统可打开的最大数量，通过 cat /proc/sys/fs/file-max 查看\n\n**用户级**：指定用户可打开的最大数量，通过 cat /etc/security/limits.conf 查看\n\n**进程级**：单个进程可打开的最大数量，通过 cat /proc/sys/fs/nr_open 查看\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-164601598868692234.png)\n\n天呢，真是人在屋檐下呀，我赶紧看了看这些具体的限制。\n\n```shell\n[root ~]# cat /proc/sys/fs/file-max\n100000\n[root ~]# cat /proc/sys/fs/nr_open\n100000\n[root ~]# cat /etc/security/limits.conf\n...\n* soft nproc 100000\n* hard nproc 100000\n```\n\n原来如此，我记得刚刚收到的最后一张纸条是。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861011.jpeg)\n\n再之后就收到文件描述符不够的错误了。\n\n我又请教老操，\"老操，那这个限制可以修改么？\"\n\n老操仍然耐心地告诉我，\"当然可以，比如你想修改单个进程可打开的最大文件描述符限制为100，可以这样。\"\n\n```shell\necho 100 > /proc/sys/fs/nr_open\n```\n\n\"原来如此，我这就去把各种文件描述符限制都改大一点，也不多，就在后面加个0吧\"\n\n\"额，早知道不告诉你小子了。\"老操再次用鄙视的眼睛看着我。\n\n**线程**\n\n突破了文件描述符限制，我又开始肆无忌惮地创建起了TCP连接。\n\n但我发现，老操的办事效率越来越慢，建立一个TCP连接花的时间越来越久。\n\n有一次，我忍不住责问老操，\"你是不是在偷懒啊？之前找你建一个TCP连接就花不到一分钟时间，你看看最近我哪次不是等一个多小时你才搞好？\"\n\n老操也忍不住了，\"小进啊你还好意思说我，你知不知道你每建一个TCP连接都需要消耗一个线程来为你服务？现在我和CPU老大那里都忙得不可开交了，一直在为你这好几十万个线程不停地进行上下文切换，我们精力有限啊，自然就没法像以前那么快为你服务了。\"\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861111.png)\n\n听完老操的抱怨，我想起了之前似乎有人跟我说过 **C10K** 问题，就是当服务器连接数达到 1 万且每个连接都需要消耗一个线程资源时，操作系统就会不停地忙于线程的上下文切换，最终导致系统崩溃，这可不是闹着玩的。\n\n我赶紧像操作系统老大请教，\"老操，实在不好意思，一直以为你强大无比，没想到也有忙得不可开交的时候呀，那我们现在应该怎么办呀？\"\n\n老操无奈地说，\"我劝你还是别再继续玩了，没什么意义，不过我想你也不会听我的，那我跟你说两句吧。\"\n\n你现在这种每建一个TCP连接就创建一个线程的方式，是最传统的多线程并发模型，早期的操作系统也只支持这种方式。但现在我进化了，我还支持 IO 多路复用的方式，简单说就是一个线程可以管理多个 TCP 连接的资源，这样你就可以用少量的线程来管理大量的 TCP 连接了。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861211.png)\n\n我一脸疑惑，\"啥是 IO 多路复用啊？\"。\n\n老操一脸鄙视，\"你这... 你去看看闪客的[《你管这破玩意叫 IO 多路复用》](http://mp.weixin.qq.com/s?__biz=Mzk0MjE3NDE0Ng==&mid=2247494866&idx=1&sn=0ebeb60dbc1fd7f9473943df7ce5fd95&chksm=c2c5967ff5b21f69030636334f6a5a7dc52c0f4de9b668f7bac15b2c1a2660ae533dd9878c7c&scene=21#wechat_redirect)，就明白了。\"\n\n这次真是大开眼界了，我赶紧把代码改成了这种 IO 多路复用的模型，将原来的 TCP 连接销毁掉，改成同一个线程管理多个 TCP 连接，很快，操作系统老大就恢复了以往的办事效率，同时我的 TCP 连接数又多了起来。\n\n**内存**\n\n突破了端口号、文件描述符、线程数等重重限制的我，再次肆无忌惮地创建起了TCP连接。\n\n直到有一次，我又收到了一张红牌。\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861311.jpeg)\n\n嗨，又是啥东西限制了呀，改了不就完了。我不耐烦地问老操，\"这回又是啥毛病？\"\n\n老操说道。\"这个错误叫内存溢出，每个TCP连接本身，以及这个连接所用到的缓冲区，都是需要占用一定内存的，现在内存已经被你占满了，不够用了，所以报了这个错。\"\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861411.png)\n\n我看这次老操特别耐心，也没多说什么，但想着被内存限制住了，有点不太开心，于是我让老操帮我最后一个忙。\n\n\"老操呀，帮小进我最后一个忙吧，你权利大，你看看把那些特别占内存的进程给杀掉，给我腾出点地方，我今天要完成我的梦想，看看TCP连接数到底能创建多少个！\"\n\n老操见我真的是够拼的，便答应了我，杀死了好多进程，我很是感动。\n\n**CPU**\n\n有了老操为我争取的内存资源，我又开始日以继日地创建TCP连接。\n\n老操也不再说什么，同样日以继日地执行着我的指令。\n\n有一次，老操语重心长地对我说，\"差不多了，我劝你就此收手吧，现在 CPU 的占用率已经快到 100% 了。\"\n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861511.png)\n\n我觉得老操这人真的可笑，经过这几次的小挫折，我明白了只要思想不滑坡，方法总比苦难多，老操这人就是太谨慎了，我岂能半途而废，不管他。\n\n我仍然继续创建着 TCP 连接。\n\n直到有一天，老操把我请到一个小饭馆，一块吃了顿饭，吃好后说道。\"咱哥俩也算是配合了很久啦，今天我是来跟你道个别的。\"\n\n我很不解地问，\"怎么了老操，发生什么事了？。\"\n\n老操说，\"由于你的 TCP 连接，CPU 占用率已经很长时间维持在 100%，我们的使用者，也就是我们的上帝，几乎什么事情都做不了了，连鼠标动一下都要等好久，所以他给我下达了一个重启的指令，我执行这个指令后，你，以及像你一样的所有进程，包括我这个操作系统本身，一切都就消失了。\"\n\n我大惊失色，\"啊，这么突然么？这条指令什么时候执行？\"\n\n老操缓缓起身，\"就现在了，刚刚这条指令还没得到 CPU 运行的机会，不过现在到了。\"\n\n突然，我眼前一黑，一切都没了。\n\n**总结**\n\n \n\n![图片](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/640-16460159886861611.png)\n\n| **资源**        | **一台Linux服务器的资源** | **一个TCP连接占用的资源** | **占满了会发生什么**            |\n| --------------- | ------------------------- | ------------------------- | ------------------------------- |\n| **CPU**         | 看你花多少钱买的          | 看你用它干嘛              | 电脑卡死                        |\n| **内存**        | 看你花多少钱买的          | 取决于缓冲区大小          | OOM                             |\n| **临时端口号**  | ip_local_port_range       | 1                         | cannot assign requested address |\n| **文件描述符**  | fs.file-max               | 1                         | too many open files             |\n| **进程\\线程数** | ulimit -n                 | 看IO模型                  | 系统崩溃                        |\n\n##### 2.客户端\n\n现在我们单独来说客户端，当一台机器作为客户端的时候，究竟能支持多少个TCP连接？ 空嘴说没有啥意思，我们直接用代码来试试。\n\n**1.小试牛刀**\n\n开始实验之前我们先来check下手头机器上的端口数量的配置\n\n```shell\n$ sysctl -a | grep ip_local_port_range\nnet.ipv4.ip_local_port_range = 15000    65000\n```\n\n通过上述内核参数的输出看到内核开放了50000个端口可以供TCP连接使用。接下来是一段看起来长，但其实非常简单的TCP客户端连接的代码。用它来连接你的任意一个TCP Server，比如Nginx、Redis啥的都可以。\n\n![img](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/v2-fcd3d7fdaf2057062a5362ea3cbb1333_720w11.jpg)\n\n我通过这段代码对我的某台机器上的Nginx发起了连接\n\n```shell\n$ php client1.php 某台服务器IP 80\n```\n\n通过netstat命令看到连接数量稳步上升，但当上升到5W的时候，出现了一条报错\n\n```text\nsocket_connect() 失败的原因是:Cannot assign requested address\n```\n\n回头想想我们的ip_local_port_range参数值，65000-15000就只开放了5万个。其实是超过这个限制了。 这个时候我们似乎可以初步得出一个相结论.**当Linux作为客户端建立连接的时候，最大连接数量是受内核参数net.ipv4.ip_local_port_range限制** 而ip_local_port_range是可配置的，最大理论范围是0-65535\n\n**进阶**\n\n如果这个时候你相信了我上面的结论的话，就又被我带了沟里了。为什么这么说，让我们来看下面的实验。\n\n首先通过ifconfig命令看到我的机器上有两块网卡，每块网卡都已经配置好了一个ip。\n\n![img](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/v2-47fd8e7180e43d4d293d73cc9ca8a1a5_720w11.jpg)\n\n接着我们修改一下第一个实验的代码，在发起连接之前允许使用`socket_bind`来绑定ip。\n\n![img](https://cdn.jsdelivr.net/gh/nebula-yzh/Interview-Images/nebula/interview/images/v2-ae5981b8e4eee69e2118609850367aea_720w11.jpg)\n\n接下来我们分别启动两个控制台，分别执行一下代码。其中10.143.x.x和10.153.x.x是实验用机的两个网卡ip。\n\n```php\n$ php client1.php 10.143.x.x 某台服务器IP 80\n$ php client2.php 10.153.x.x 某台服务器IP 80\n```\n\n这个时候通过ss命令监控本机的ESTABLISH连接，发现已经突破5万，并向10万逼近了。\n\n```shell\n$ ss -n | grep ESTAB | wc –l\n90005 \n```\n\n现在我们终于可以得出更为正确的结论了，**对于有1个Ip的客户端来说，受限于ip_local_port_range参数，也受限于65535。但单Linux可以配置多个ip，有几个ip，最大理论值就翻几倍**\n\n> 多张网卡不是必须的。即使只有一张网卡，也可以配置多ip。k8s就是这么干的，在k8s里，一台物理机上可以部署多个pod。但每一个pod都会被分配一个独立的ip，所以完全不用担心物理机上部署了过多的pod而影响你用的pod里的TCP连接数量。在ip给你的那一刻，你的pod就和其它应用隔离开了。\n\n##### 3.服务端\n\n我们现在在来回头考虑服务器端。对于服务器来说，最大支持的并发连接是多少呢？就有人开始可爱地糊涂了：“服务器端理论也是端口限制吗？”。好，假设如果受影响的话，那我们的Nginx服务器只监听了一个80端口。那Nginx只能接受一个TCP连接喽？这明显是太荒唐了。\n\n好，我们再看另外一个靠谱一点的答案。那就是一条TCP连接是由一个四元组组成的。不考虑地址重用（unix的SO_REUSEADDR选项）的情况下，对于我们这台Nginx Server来说，它的IP和端口是固定的。cp连接4元组中只有remote ip（也就是client ip）和remote port（客户端port）是可变的。它可能建立的最大的连接数是2的32次方（ip数）×2的16次方（port数）。这是2.8*10的14次方的一个大数字，两百万亿！！\n\nLinux上除了监听80以外，还可以监听其它的端口，例如Mysql的3306, Redis的6339，当然所有65535个端口你都可以用来监听一遍。这样理论上线就到了2的32次方（ip数）×2的16次方（port数）×2的16次方（服务器port数）个。感兴趣你可以算一下，这个基本相当于无穷个了。\n\n不过理想和实际总是会有差距的，因为Linux每维护一条TCP连接都要花费资源。处理连接请求，保活，数据的收发时需要消耗一些CPU，维持TCP连接主要消耗内存。我们题目的问题是考虑最大多少个连接，所以我们先不考虑数据的收发。那么TCP在静止的状态下，就不怎么消耗CPU了，主要消耗内存。而Linux上内存是有限的。\n我们今天先直接把结论抛出来，一条TCP连接如果不发送数据的话，消耗内存是3.3K左右。如果有数据发送，需要为每条TCP分配发送缓存区，大小受你的参数net.ipv4.tcp_wmem配置影响，默认情况下最小是4K。如果发送结束，缓存区消耗的内存会被回收详细的分析过程敬请期待接下来的另一篇文章。\n\n**假设你只保持连接不发送数据，那么你服务器可以建立的连接最大数量 = 你的内存/3.3K。** 假如是4GB的内存，那么大约可接受的TCP连接数量是100万左右。\n\n> 这个例子里，我们考虑的前提是在一个进程下hold所有的服务器端连接。而在实际中的项目里，为了收发数据方便，很多网络IO模型还会为TCP连接再创建一个线程或协程。拿最轻量的golang来说，一个协程栈也需要2KB的内存开销。\n\n##### 结论\n\n一台机器最大究竟能支持多少个网络连接？根据不同的情况，不同条件进行分析！\n\n这个简单的问题里其实埋了坑，导致无数的英雄好汉被困惑不解。就和树上九只鸟打死一只还剩几只的问题一样，没有和你说清楚树上是真鸟，还是假鸟。也没有说枪是有声还是无声的。通过今天的分析，相信你终于可以扬眉吐气把这个问题踩在脚下摩擦了。来，总结下：\n\n- **TCP连接的客户端机：** 每一个ip可建立的TCP连接理论受限于ip_local_port_range参数，也受限于65535。但可以通过配置多ip的方式来加大自己的建立连接的能力。\n- **TCP连接的服务器机：** 每一个监听的端口虽然理论值很大，但这个数字没有实际意义。最大并发数取决你的内存大小，每一条静止状态的TCP连接大约需要吃3.3K的内存。','# 计算机网络面经整理','','','','','2021-11-27 14:18:56','2022-03-04 22:40:04',6126,13776,69,3,'','',1);

