\":\"java基础\",\"color\":\"purple\",\"blogs\":[]}}','添加标签','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',16,'2021-11-27 13:46:08','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 Safari/537.36'),(21,'Admin','/admin/category','DELETE','{\"id\":1}','删除分类','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',16,'2021-11-27 13:47:24','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 Safari/537.36'),(22,'Admin','/admin/category','DELETE','{\"id\":2}','删除分类','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',13,'2021-11-27 13:47:26','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 Safari/537.36'),(23,'Admin','/admin/category','POST','{\"category\":{\"id\":3,\"name\":\"面经整理\",\"blogs\":[]}}','添加分类','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',12,'2021-11-27 13:47:33','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 Safari/537.36'),(24,'Admin','/admin/category','POST','{\"category\":{\"id\":4,\"name\":\"学习笔记\",\"blogs\":[]}}','添加分类','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',26,'2021-11-27 13:47:39','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 Safari/537.36'),(25,'Admin','/admin/blog','POST','{\"blog\":{\"id\":1,\"title\":\"计算机网络\",\"firstPicture\":\"http://localhost:8080/assets/img/logo.png\",\"content\":\"##### 1.TCP/IP四层模型\\n\\n网络接口层，网际层，传输层，应用层\\n\\n**网络接口层**：这是TCP/IP软件的最低层，负责接收IP数据包并通过网络发送之，或者从网络上接收物理帧，抽出IP数据报，交给IP层。(帧，网络接口协议)\\n\\n**网际层**：负责点到点（point-to-point）的传输（这里的\\\"点\\\"指主机或路由器）主要定义了IP地址格式,使得不同应用类型的数据在Internet上传输。提供基本的数据封包传送功能，让每一块数据包都能够到达目的主机（但不检查是否被正确接收），如网际协议（IP）\\n\\n**传输层**：提供端到端(end-to-end)的传输(这里的\\\"端\\\"指源主机到目标主机) 在此层中，它提供了节点间的数据传送服务，如传输控制协议（TCP）、用户数据报协议（UDP）等，TCP和UDP给数据包加入传输数据并把它传输到下一层中，这一层负责传送数据，并且确定数据已被送达并接收\\n\\n**应用层** 应用程序间沟通的层，如简单电子邮件传输(SMTP)文件传输协议（FTP）网络远程访问协议（Telnet）域名解析协议（DNS）等\\n\\n##### 2.OSI七层模型\\n\\n物理层，数据链路层，网络层，传输层，会话层，表示层，应用层\\n\\n**应用层：**就是应用软件使用的协议，如邮箱使用的POP3，SMTP、远程登录使用的Telnet、获取IP地址的DHCP、域名解析的DNS、网页浏览的http协议等；这部分协议主要是规定应用软件如何去进行通信的。\\n\\n**表示层：**决定数据的展现（编码）形式，如同一部电影可以采样、量化、编码为RMVB、AVI，一张图片能够是JPEG、BMP、PNG等。\\n\\n**会话层：**为两端通信实体建立连接（会话），中间有认证鉴权以及检查点记录（供会话意外中断的时候可以继续，类似断点续传）。\\n\\n**传输层：**将一个数据/文件斩件分成很多小段，标记顺序以被对端接收后可以按顺序重组数据，另外标记该应用程序使用的端口号及提供QOS。（不同的应用程序使用不同计算机的端口号，同样的应用程序需要使用一样的端口号才能正常通信）\\n\\n**网络层：**路由选择，选择本次通信使用的协议（http、ftp等），指定路由策略及访问控制策略。（IP地址在这一层）\\n\\n**数据链路层：**根据端口与MAC地址，做分组（VLAN）隔离、端口安全、访问控制。（MAC地址在这一层）处理VLAN内的数据帧转发，跨VLAN间的访问，需要上升到网络层。封装成帧、透明传输、差错检测（循环冗余检测保证传输过程中的数据准确性）。\\n\\n**物理层：**将数据最终编码为用0、1标识的比特流，然后传输。（例如将题主头像的图片，变为一串01100111100这样的数字来表示）。\\n\\n<img src=\\\"F:\\\\学习\\\\java内容整理\\\\java-picture\\\\OSI七层.png\\\" alt=\\\"OSI七层\\\" style=\\\"zoom: 80%;\\\" />\\n\\n##### 3.ping 是通过什么协议实现的？ \\n\\nping是通过ICMP(网际报文控制协议实现)，它属于TCP/IP协议簇中的子协议，与IP协议位于同一层，属于网络层协议，它是定位网络通不通的一个重要手段。\\n\\nping不需要端口号，因为ping是应用层直接使用网络层ICMP的一个例子，而端口是运输层的概念，ping并没有通过运输层的TCP和UDP等。\\n\\n##### 4.DNS 域名解析的主要过程 \\n\\nDNS(Domain Name System)属于应用层协议，它的的功能是进行域名解析，将由字母数字组成的域名转换成由数字组成的IP地址。\\n\\n###### 域名解析的详细过程：\\n\\n1. 当输入一个域名时，比如www.baidu.com，浏览器会检查缓存中有没有这个域名对应的解析的IP地址，如有，则解析结束。\\n2. 若没有，浏览器会查找操作系统缓存中是否有这个域名对应的DNS解析结果。\\n3. 若本机无法完成域名的解析，就会真正请求域名服务器来解析这个域名了。操作系统会发送域名到Local DNS（本地的域名服务器），大约80%的域名解析到这里就已经结束，所以Local DNS承担着主要的域名解析任务。\\n4. 若Local DNS未命中，就直接到根域名服务器(Root Server)请求解析。\\n5. 根域名服务器返回给本地域名服务器一个所查询域的主域名服务器(Top Level Domain (TLD) ','发布博客','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',464,'2021-11-27 14:18:57','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 Safari/537.36'),(26,'Admin','/admin/comment','DELETE','{\"id\":1}','删除评论','10.128.216.30','内网IP|内网IP','Windows 10','Chrome 96.0.4664.45',8,'2021-11-27 14:19:16','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.45 